import React from "react";

const Home = () => {
    return (
        <section>
            <div className="container-fluid nav_bg">
                <div className="row">
                    <div className="col-10 mx-auto">
                    <h1>Welcome to the Website</h1>
                    </div>
                </div>
            </div>
        </section>
    )
}
export default Home;
